source.buildSpec:
{
  "version": 0.2,
  "phases": {
    "install": {
      "runtime-versions": {
        "nodejs": "14"
      },
      "commands": [
        "npm install",
        "npm install -g aws-cdk "
      ]
    },
    "build": {
      "commands": [
        "npm run build",
        "cdk synth --output ./cdk.out",
        "echo \"The template path is: ${CODEBUILD_SRC_DIR}/cdk1.out/LambdaStack4-test.template.json\"",
        "ls -l ${CODEBUILD_SRC_DIR}/cdk1.out/LambdaStack4-test.template.json"
      ]
    }
  },
  "artifacts": {
    "base-directory": "cdk.out",
    "files": [
      "**/*"
    ]
  }
}
